window.bookSummaryJSON = "<p>Raise your hand if your company needs more new customers. </p> <p>I suspect your hand is (figuratively) up. This book is about not just growth, but high-growth, explosive-growth, the kind of growth that weather satellites can see from space. The success of any business-to-business company is directly linked to how effectively they acquire new pipeline. To skyrocket growth, sales development is the answer. </p> <p>This book encapsulates author Trish Bertuzzi's three decades of practical, hands-on experience. It presents six elements for building new pipeline and accelerating revenue growth with inside sales. </p>"; 
